import React from 'react';
import Menu from './components/Menu.js';
import Order from './components/Order.js';

//import logo from './logo.svg';
import './App.css';

function App() {
  state = {}
  fetch("https://www.neckch.in/sbistro/menu.json")
    .then(res => res.json())
    .then(response => this.setState(response));
  return (
    <div className="App">
      <Menu/>
      <Order/>
    </div>
  );
}

export default App;
